INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (6, N'Сыр натереть на мелкой терке, добавить муку, яйцо. Перемешать. Сформировать сырные палочки.', 1, 30)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (7, N'Обжарить их в растительном масле до золотистого цвета.', 1, 20)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (8, N'Картошку предварительно сварим в мундире.', 2, 30)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (10, N'Отварную картошку разрежем пополам.', 2, 5)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (11, N'Сыр и колбасу натрем на терке.', 2, 10)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (12, N'Из половинок картофеля аккуратно удалим внутреннюю часть чайной ложкой.', 2, 5)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (13, N'Смешаем мякоть картофеля с сыром и колбасой. Добавим соль и перец по вкусу.', 2, 5)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (14, N'Добавим сметану и перемешаем начинку.', 2, 5)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (15, N'Наполним половинки картофеля приготовленной начинкой.', 2, 5)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (16, N'Форму для запекания смажем растительным или сливочным маслом. Выложим в форму фаршированную картошку с сыром и колбасой и поставим в духовку, разогретую до 200 градусов. Будем запекать фаршированный картофель в духовке 10-15 минут.', 2, 20)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (17, N'Готовый запеченный картофель украсим свежей зеленью.', 2, 5)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (18, N'Куриное филе вымыть и обсушить.', 3, 5)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (19, N'Филе нарезать кусочками.', 3, 10)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (20, N'Лук репчатый очистить, помыть и мелко нарезать кубиками.', 3, 10)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (21, N'Разогреть сковороду. Налить растительное масло. Выложить филе и лук, жарить, помешивая, на среднем огне до готовности (около 20 минут).', 3, 25)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (22, N'Посолить, поперчить, добавить специи. Перемешать. Добавить сметану (или сливки). Перемешать. Накрыть крышкой. Довести до кипения и снять с огня. Оставить под крышкой еще на 5-10 минут.', 3, 20)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (23, N'Налить в кастрюлю воду, вскипятить, посолить воду. В кипящую воду опустить макаронные изделия, перемешать, налить 2 ч. ложки растительного масла. Дать вскипеть, перемешать. Варить на среднем огне до готовности, согласно инструкции (7-10 минут).', 3, 20)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (24, N'Откинуть на дуршлаг готовые макароны. Дать воде стечь.', 3, 5)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (25, N'Выложить пасту к курице. Хорошо перемешать пасту с куриной грудкой и можно подавать.', 3, 5)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (26, N'Отварить яйца', 4, 15)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (27, N'Колбасу нарезать кубиками.', 4, 5)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (28, N'Яйца нарезать кубиками.', 4, 5)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (29, N'Сыр натереть на тёрке.', 4, 10)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (30, N'Соединить колбасу, сыр, яйца и кукурузу.', 4, 5)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (31, N'Все ингредиенты смешать и заправить салат "Ежик" майонезом.', 4, 5)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (32, N'Кофе пересыпьте в глубокую миску или чашу для взбивания.', 5, 5)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (33, N'Залейте кофе холодной кипячёной водой.', 5, 2)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (34, N'Миксером взбейте воду с кофе в лёгкую пену, около минуты.', 5, 3)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (35, N'Всыпьте сахар.', 5, 2)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (37, N'Теперь миксером на высокой скорости взбейте кофе с водой и сахаром до стабильной, крепкой и устойчивой пены. На это понадобится около 3 минут.', 5, 3)
GO
INSERT [dbo].[CookingStage] ([Id], [Description], [DishId], [TimeInMinutes]) VALUES (38, N'Разложите кофейную пену в креманки или стаканы и подайте к столу.', 5, 5)
GO
